import React from 'react'
import Navbar from '../components/navbar/Navbar'
import HotelList from '../components/hotellist/HotelList'

const HotelListingwithFilter = () => {
  return (
    <div>
        <Navbar />
        <HotelList />
    </div>
  )
}

export default HotelListingwithFilter
